member.param:
存在以下2种形式
@RemoteIP@RemotePort 以任意的本机端口用客户端模式连接对应的远程地址及远程端口
LocalPort@@ 以指定的本机端口用服务器模式监听 直至有客户端连接上

存在以下2种形式
LocolPort@RemoteIP@RemotePort 表示使用LocolPort端口监听并连接RemoteIP地址下的RemotePort端口
@RemoteIP@RemotePort 表示可使用任意端口监听并连接RemoteIP地址下的RemotePort端口

member.example:
protected override void WndProc(ref Message m)
{
   HotkeyObj.ProcessHotKey(m);
   base.WndProc(ref m);
}
